				</p>
				<div className="links">
					<Link className="styled-link" to="/login">
						Log In
					</Link>
					<Link className="styled-link" to="/signup">
						Sign Up
					</Link>
				</div>
			</div>
			<div className="img-placeholder">
				<p className="placeholder">image to be placed later</p>
			</div>
		</div>
	);
};

export default Home;
